import React from 'react';

export default class Logcr extends React.Component {
  render() {
    return (
      <div className='logcr'>
        <div className='emps'>
          <h2>
            <b>{this.props.email}</b>
          </h2>
          <p>
            <b>{this.props.password}</b>
          </p>
        </div>
      </div>
    );
  }
}
